import React from 'react'

const Footer = () => {
  return (
    <>
    <footer className="footer bg-secondary ">
      <div className="container text-center ">
        <span className="text-white " >Compyright@JM-Company-2022.</span>
      </div>
    </footer>
    </>
  )
}

export default Footer
